import './owners.css';
import Navbar from "../../Navbar";
import Footer from "../../Footer";
import { Link } from 'react-router-dom';

export default function Owners() {
    const[owners, setOwners] = useState([])
    useEffect(() => {
        console.log("")
        fetchData()
    },[]);
    
    const fetchData = async()=>{
        try {
            const response = await axios.get("http://localhost:5000/api/owners")
            setOwners(response.data)
        } catch (error) {
            console.log("Error while fetching data", error)
        }
    };
    
    
    return (
        <>
        <Navbar/>
            <div className='general'>
                <div className='container '>
                    <br /><br /><br />
                    <h1> Find Owner </h1>
                    <br /><br /><br />
                    <label> Last Name :</label>
                    <input type="text" id="input-name" class="form-control col-8 ml-0 text-hover-costem" placeholder="Last Name" aria-label="Username" aria-describedby="addon-wrapping" />

                    <Link to="/FindOwner" className="btn-fowner">
                        Find Owner
                    </Link>
                        <br /><br />
                        
                    <Link to="/AddOwner" className="btn-fowner">
                        Add Owner
                    </Link>
                </div>

            </div>

            <>
        
        <div class="container mt-4">
            <h1 class="mb-4">Owners</h1>
            <br />
            <div class="table-responsive ">
                <table class="table table-striped table-hover">
                    <thead class="table-dark">
                        <tr>
                            <th>Name</th>
                            <th>Address</th>
                            <th>City</th>
                            <th>Telephone</th>
                            <th>Pets</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><Link to="/owner/:id">George Franklin</Link></td>
                            <td>110 W. Liberty St.</td>
                            <td>Madison</td>
                            <td>6085551023</td>
                            <td>Leo</td>
                        </tr>
                      
                        
                       
                    </tbody>
                </table>
            </div>
        </div>
            </>
            <Footer/>
        </>
    );
}
